function App(){
  return (
    <>
      <Navbar />
      <hr style={{ margin: 0 }}/>
      <NavBarButton />
      <hr style={{ margin: 0 }} />
      <MainContainer>
        {/* Hotel Detail Container */}
        <HotelList/>
        {/* Map Container */}
      </MainContainer>
    </>
  );
}



const MainContainer = styled.div`
display:flex;
`
export default App;
